import { Dimensions, StyleSheet } from 'react-native';

const styles=StyleSheet.create({
    container:{
        position:'absolute',
        zIndex:5,
        width:'100%',
        height:Dimensions.get('window').height,
        backgroundColor: 'black',
        opacity:'0.4',
        justifyContent:'center',
        alignItems:'center'
    },
    contentWrap:{
        width:'70%',
        backgroundColor:'white'
    }
})
export default styles
